import React, { Fragment } from 'react';
import { Menu, Transition } from '@headlessui/react';
import { 
  UserCircleIcon, 
  Cog6ToothIcon, 
  ArrowRightOnRectangleIcon,
  ChevronDownIcon 
} from '@heroicons/react/24/outline';
import { User } from '../../types';

interface UserMenuProps {
  user: User | null;
  onLogout: () => void;
}

const UserMenu: React.FC<UserMenuProps> = ({ user, onLogout }) => {
  if (!user) {
    return null;
  }

  const getRoleColor = (role: string) => {
    switch (role) {
      case 'super-admin':
        return 'text-purple-600 dark:text-purple-400';
      case 'admin':
        return 'text-primary-600 dark:text-primary-400';
      case 'viewer':
        return 'text-gray-600 dark:text-gray-400';
      default:
        return 'text-gray-600 dark:text-gray-400';
    }
  };

  const getRoleBadge = (role: string) => {
    const baseClasses = 'text-xs px-2 py-0.5 rounded-full font-medium';

    switch (role) {
      case 'super-admin':
        return `${baseClasses} bg-purple-100 text-purple-800 dark:bg-purple-900/20 dark:text-purple-400`;
      case 'admin':
        return `${baseClasses} bg-primary-100 text-primary-800 dark:bg-primary-900/20 dark:text-primary-400`;
      case 'viewer':
        return `${baseClasses} bg-gray-100 text-gray-800 dark:bg-gray-800 dark:text-gray-400`;
      default:
        return `${baseClasses} bg-gray-100 text-gray-800 dark:bg-gray-800 dark:text-gray-400`;
    }
  };

  return (
    <Menu as="div" className="relative">
      <Menu.Button className="flex items-center space-x-3 p-2 rounded-lg hover:bg-gray-100 dark:hover:bg-gray-700 transition-colors w-full text-left group">
        <div className="flex-shrink-0">
          <div className="w-8 h-8 bg-gradient-to-r from-primary-500 to-primary-600 rounded-full flex items-center justify-center">
            <span className="text-white text-sm font-semibold">
              {user.displayName.charAt(0).toUpperCase()}
            </span>
          </div>
        </div>

        <div className="flex-1 min-w-0">
          <div className="flex items-center space-x-2">
            <p className="text-sm font-medium text-gray-900 dark:text-white truncate">
              {user.displayName}
            </p>
            <span className={getRoleBadge(user.role)}>
              {user.role.replace('-', ' ')}
            </span>
          </div>
          <p className="text-xs text-gray-500 dark:text-gray-400 truncate">
            {user.email}
          </p>
        </div>

        <ChevronDownIcon className="w-4 h-4 text-gray-400 group-hover:text-gray-600 dark:group-hover:text-gray-300 transition-colors" />
      </Menu.Button>

      <Transition
        as={Fragment}
        enter="transition ease-out duration-100"
        enterFrom="transform opacity-0 scale-95"
        enterTo="transform opacity-100 scale-100"
        leave="transition ease-in duration-75"
        leaveFrom="transform opacity-100 scale-100"
        leaveTo="transform opacity-0 scale-95"
      >
        <Menu.Items className="absolute bottom-full left-0 mb-2 w-full bg-white dark:bg-gray-800 rounded-lg shadow-lg ring-1 ring-black ring-opacity-5 focus:outline-none py-1 z-50">
          <Menu.Item>
            {({ active }) => (
              <button
                className={`${
                  active ? 'bg-gray-100 dark:bg-gray-700' : ''
                } flex items-center space-x-3 px-3 py-2 text-sm text-gray-700 dark:text-gray-300 w-full text-left transition-colors`}
              >
                <UserCircleIcon className="w-4 h-4" />
                <span>Profilo</span>
              </button>
            )}
          </Menu.Item>

          <Menu.Item>
            {({ active }) => (
              <button
                className={`${
                  active ? 'bg-gray-100 dark:bg-gray-700' : ''
                } flex items-center space-x-3 px-3 py-2 text-sm text-gray-700 dark:text-gray-300 w-full text-left transition-colors`}
              >
                <Cog6ToothIcon className="w-4 h-4" />
                <span>Impostazioni</span>
              </button>
            )}
          </Menu.Item>

          <hr className="my-1 border-gray-200 dark:border-gray-600" />

          <Menu.Item>
            {({ active }) => (
              <button
                onClick={onLogout}
                className={`${
                  active ? 'bg-gray-100 dark:bg-gray-700' : ''
                } flex items-center space-x-3 px-3 py-2 text-sm text-error-600 dark:text-error-400 w-full text-left transition-colors`}
              >
                <ArrowRightOnRectangleIcon className="w-4 h-4" />
                <span>Logout</span>
              </button>
            )}
          </Menu.Item>
        </Menu.Items>
      </Transition>
    </Menu>
  );
};

export default UserMenu;
